import React from "react";
import example from "./example";

const Listing = () => {
  return (
    <ul>
      {example.map(
        (item) => (
          (<li>{item.img}</li>),
          (<li>{item.propertyType}</li>),
          (<li>{item.address}</li>),
          (<li>{item.price}</li>),
          (<li>{item.structure}</li>),
          (<li>{item.options}</li>)
        )
      )}
    </ul>
  );
};

export default Listing;
